import { useEffect, useState } from "react";
import setTheme from "../../utils/Themes";

function Recommender() {

    useEffect(() => {
        setTheme('#38003c', 'purple')
    })
    
    return (
        <h1>Recommender</h1>
    )
}
	


export default Recommender;
